import StageNodeModel from "../components/diagram/models/StageNodeModel";
import ActionNodeModel from "../components/diagram/models/ActionNodeModel";
import PackDiagramModel from "../components/diagram/models/PackDiagramModel";
import CoverNodeModel from "../components/diagram/models/CoverNodeModel";
import MenuNodeModel from "../components/diagram/models/MenuNodeModel";
import StoryNodeModel from "../components/diagram/models/StoryNodeModel";


export function simplifiedSample() {

    let model = new PackDiagramModel('SimplifiedSamplePack');

    let cover = new CoverNodeModel({ name: "Pack selection stage" });
    cover.setImage('data:image/png;base64,');
    cover.setAudio('data:audio/ogg;base64,');
    cover.setPosition(50, 300);

    let characterMenu = new MenuNodeModel({ name: "Choose a character" });
    characterMenu.setQuestionAudio('data:audio/ogg;base64,');
    characterMenu.addOption();
    characterMenu.setOptionName(0, 'Alice');
    characterMenu.setOptionImage(0, 'data:image/png;base64,');
    characterMenu.setOptionAudio(0, 'data:audio/ogg;base64,');
    characterMenu.addOption();
    characterMenu.setOptionName(1, 'Bob');
    characterMenu.setOptionImage(1, 'data:image/png;base64,');
    characterMenu.setOptionAudio(1, 'data:audio/ogg;base64,');
    characterMenu.setPosition(300, 200);

    let alicePlaceMenu = new MenuNodeModel({ name: "Choose a place (Alice)" });
    alicePlaceMenu.setQuestionAudio('data:audio/ogg;base64,');
    alicePlaceMenu.addOption();
    alicePlaceMenu.setOptionName(0, 'Jungle (Alice)');
    alicePlaceMenu.setOptionImage(0, 'data:image/png;base64,');
    alicePlaceMenu.setOptionAudio(0, 'data:audio/ogg;base64,');
    alicePlaceMenu.addOption();
    alicePlaceMenu.setOptionName(1, 'City (Alice)');
    alicePlaceMenu.setOptionImage(1, 'data:image/png;base64,');
    alicePlaceMenu.setOptionAudio(1, 'data:audio/ogg;base64,');
    alicePlaceMenu.setPosition(750, 50);

    let bobPlaceMenu = new MenuNodeModel({ name: "Choose a place (Bob)" });
    bobPlaceMenu.setQuestionAudio('data:audio/ogg;base64,');
    bobPlaceMenu.addOption();
    bobPlaceMenu.setOptionName(0, 'Jungle (Bob)');
    bobPlaceMenu.setOptionImage(0, 'data:image/png;base64,');
    bobPlaceMenu.setOptionAudio(0, 'data:audio/ogg;base64,');
    bobPlaceMenu.addOption();
    bobPlaceMenu.setOptionName(1, 'Desert (Bob)');
    bobPlaceMenu.setOptionImage(1, 'data:image/png;base64,');
    bobPlaceMenu.setOptionAudio(1, 'data:audio/ogg;base64,');
    bobPlaceMenu.setPosition(750, 400);

    let aliceStory1 = new StoryNodeModel({ name: "Story: Alice + Jungle" });
    aliceStory1.setAudio('data:audio/ogg;base64,');
    aliceStory1.setPosition(1100, 50);

    let aliceStory2 = new StoryNodeModel({ name: "Story: Alice + City" });
    aliceStory2.setAudio('data:audio/ogg;base64,');
    aliceStory2.setPosition(1100, 220);

    let bobStory1 = new StoryNodeModel({ name: "Story: Bob + Jungle" });
    bobStory1.setAudio('data:audio/ogg;base64,');
    bobStory1.setPosition(1100, 400);

    let bobStory2 = new StoryNodeModel({ name: "Story: Bob + Desert" });
    bobStory2.setAudio('data:audio/ogg;base64,');
    bobStory2.setPosition(1100, 570);


    model.addAll(
        // Nodes
        cover,
        characterMenu,
        alicePlaceMenu,
        bobPlaceMenu,
        aliceStory1,
        aliceStory2,
        bobStory1,
        bobStory2,

        // When pack is selected, go to character menu
        cover.okPort.link(characterMenu.fromPort),

        // First character option, go to place menu
        characterMenu.optionsOut[0].link(alicePlaceMenu.fromPort),

        // Second character option, go to place menu
        characterMenu.optionsOut[1].link(bobPlaceMenu.fromPort),

        // Alice place options, go and play the chosen story
        alicePlaceMenu.optionsOut[0].link(aliceStory1.fromPort),
        alicePlaceMenu.optionsOut[1].link(aliceStory2.fromPort),

        // Bob place options, go and play the chosen story
        bobPlaceMenu.optionsOut[0].link(bobStory1.fromPort),
        bobPlaceMenu.optionsOut[1].link(bobStory2.fromPort),
    );

    return model;
}


export function sample() {
    let model = new PackDiagramModel('SamplePack');

    let packSelectionNode = new StageNodeModel({ name: "Pack selection stage" });
    packSelectionNode.setSquareOne(true);
    packSelectionNode.setControl('wheel', true);
    packSelectionNode.setControl('ok', true);
    packSelectionNode.setImage('data:image/png;base64,');
    packSelectionNode.setAudio('data:audio/ogg;base64,');
    packSelectionNode.setPosition(50, 200);

    let questionsNode = new ActionNodeModel({ name: "Questions" });
    questionsNode.setPosition(350, 200);
    let questionsOption1Ports = questionsNode.addOption();
    let questionsOption2Ports = questionsNode.addOption();
    let questionsOption3Ports = questionsNode.addOption();

    let question1Node = new StageNodeModel({ name: "Choose a character" });
    question1Node.setControl('autoplay', true);
    question1Node.setAudio('data:audio/ogg;base64,');
    question1Node.setPosition(650, 25);

    let characterChoicesNode = new ActionNodeModel({ name: "Characters" });
    characterChoicesNode.setPosition(950, 25);
    let characterChoice1Ports = characterChoicesNode.addOption();
    let characterChoice2Ports = characterChoicesNode.addOption();

    let character1Node = new StageNodeModel({ name: "Alice" });
    character1Node.setControl('wheel', true);
    character1Node.setControl('ok', true);
    character1Node.setControl('home', true);
    character1Node.setImage('data:image/png;base64,');
    character1Node.setAudio('data:audio/ogg;base64,');
    character1Node.setPosition(1250, 25);

    let character2Node = new StageNodeModel({ name: "Bob" });
    character2Node.setControl('wheel', true);
    character2Node.setControl('ok', true);
    character2Node.setControl('home', true);
    character2Node.setImage('data:image/png;base64,');
    character2Node.setAudio('data:audio/ogg;base64,');
    character2Node.setPosition(1250, 175);

    let aliceQuestion2Node = new StageNodeModel({ name: "Choose a place (Alice)" });
    aliceQuestion2Node.setControl('autoplay', true);
    aliceQuestion2Node.setAudio('data:audio/ogg;base64,');
    aliceQuestion2Node.setPosition(650, 325);

    let alicePlaceChoicesNode = new ActionNodeModel({ name: "Places (Alice)" });
    alicePlaceChoicesNode.setPosition(950, 325);
    let alicePlaceChoice1Ports = alicePlaceChoicesNode.addOption();
    let alicePlaceChoice2Ports = alicePlaceChoicesNode.addOption();

    let alicePlace1Node = new StageNodeModel({ name: "Jungle (Alice)" });
    alicePlace1Node.setControl('wheel', true);
    alicePlace1Node.setControl('ok', true);
    alicePlace1Node.setControl('home', true);
    alicePlace1Node.setImage('data:image/png;base64,');
    alicePlace1Node.setAudio('data:audio/ogg;base64,');
    alicePlace1Node.setPosition(1250, 325);

    let alicePlace2Node = new StageNodeModel({ name: "City (Alice)" });
    alicePlace2Node.setControl('wheel', true);
    alicePlace2Node.setControl('ok', true);
    alicePlace2Node.setControl('home', true);
    alicePlace2Node.setImage('data:image/png;base64,');
    alicePlace2Node.setAudio('data:audio/ogg;base64,');
    alicePlace2Node.setPosition(1250, 475);

    let bobQuestion2Node = new StageNodeModel({ name: "Choose a place (Bob)" });
    bobQuestion2Node.setControl('autoplay', true);
    bobQuestion2Node.setAudio('data:audio/ogg;base64,');
    bobQuestion2Node.setPosition(650, 625);

    let bobPlaceChoicesNode = new ActionNodeModel({ name: "Places (Bob)" });
    bobPlaceChoicesNode.setPosition(950, 625);
    let bobPlaceChoice1Ports = bobPlaceChoicesNode.addOption();
    let bobPlaceChoice2Ports = bobPlaceChoicesNode.addOption();

    let bobPlace1Node = new StageNodeModel({ name: "Jungle (Bob)" });
    bobPlace1Node.setControl('wheel', true);
    bobPlace1Node.setControl('ok', true);
    bobPlace1Node.setControl('home', true);
    bobPlace1Node.setImage('data:image/png;base64,');
    bobPlace1Node.setAudio('data:audio/ogg;base64,');
    bobPlace1Node.setPosition(1250, 625);

    let bobPlace2Node = new StageNodeModel({ name: "Desert (Bob)" });
    bobPlace2Node.setControl('wheel', true);
    bobPlace2Node.setControl('ok', true);
    bobPlace2Node.setControl('home', true);
    bobPlace2Node.setImage('data:image/png;base64,');
    bobPlace2Node.setAudio('data:audio/ogg;base64,');
    bobPlace2Node.setPosition(1250, 775);

    let storiesNode = new ActionNodeModel({ name: "Stories" });
    storiesNode.setPosition(1650, 550);
    let storiesOption1Ports = storiesNode.addOption();
    let storiesOption2Ports = storiesNode.addOption();
    let storiesOption3Ports = storiesNode.addOption();
    let storiesOption4Ports = storiesNode.addOption();

    let aliceStory1Node = new StageNodeModel({ name: "Alice + Jungle" });
    aliceStory1Node.setControl('home', true);
    aliceStory1Node.setControl('pause', true);
    aliceStory1Node.setControl('autoplay', true);
    aliceStory1Node.setAudio('data:audio/ogg;base64,');
    aliceStory1Node.setPosition(2000, 325);

    let aliceStory2Node = new StageNodeModel({ name: "Alice + City" });
    aliceStory2Node.setControl('home', true);
    aliceStory2Node.setControl('pause', true);
    aliceStory2Node.setControl('autoplay', true);
    aliceStory2Node.setAudio('data:audio/ogg;base64,');
    aliceStory2Node.setPosition(2000, 475);

    let bobStory1Node = new StageNodeModel({ name: "Bob + Jungle" });
    bobStory1Node.setControl('home', true);
    bobStory1Node.setControl('pause', true);
    bobStory1Node.setControl('autoplay', true);
    bobStory1Node.setAudio('data:audio/ogg;base64,');
    bobStory1Node.setPosition(2000, 625);

    let bobStory2Node = new StageNodeModel({ name: "Bob + Desert" });
    bobStory2Node.setControl('home', true);
    bobStory2Node.setControl('pause', true);
    bobStory2Node.setControl('autoplay', true);
    bobStory2Node.setAudio('data:audio/ogg;base64,');
    bobStory2Node.setPosition(2000, 775);


    model.addAll(
        // Stage and action nodes
        packSelectionNode,
        questionsNode,
        question1Node,
        characterChoicesNode,
        character1Node,
        character2Node,
        aliceQuestion2Node,
        alicePlaceChoicesNode,
        alicePlace1Node,
        alicePlace2Node,
        bobQuestion2Node,
        bobPlaceChoicesNode,
        bobPlace1Node,
        bobPlace2Node,
        storiesNode,
        aliceStory1Node,
        aliceStory2Node,
        bobStory1Node,
        bobStory2Node,

        // When pack is selected, go to question 1 (choose character)
        packSelectionNode.okPort.link(questionsOption1Ports.in),

        // Question 1 stage node, go to first character option
        questionsOption1Ports.out.link(question1Node.fromPort),
        question1Node.okPort.link(characterChoice1Ports.in),

        // First character option, go to question 2 (choose place) or back to question 1
        characterChoice1Ports.out.link(character1Node.fromPort),
        character1Node.okPort.link(questionsOption2Ports.in),
        // No home transition (but HOME button enabled) --> back to main (pack selection) stage node

        // Second character option, go to question 3 (choose place) or back to question 1
        characterChoice2Ports.out.link(character2Node.fromPort),
        character2Node.okPort.link(questionsOption3Ports.in),
        // No home transition (but HOME button enabled) --> back to main (pack selection) stage node

        // Question 2 for character 1, go and play the chosen story or back to question 1
        questionsOption2Ports.out.link(aliceQuestion2Node.fromPort),
        aliceQuestion2Node.okPort.link(alicePlaceChoice1Ports.in),
        alicePlaceChoice1Ports.out.link(alicePlace1Node.fromPort),
        alicePlace1Node.okPort.link(storiesOption1Ports.in),
        alicePlace1Node.homePort.link(questionsOption1Ports.in),
        alicePlaceChoice2Ports.out.link(alicePlace2Node.fromPort),
        alicePlace2Node.okPort.link(storiesOption2Ports.in),
        alicePlace2Node.homePort.link(questionsOption1Ports.in),

        // Question 3 for character 2, go and play the chosen story or back to question 1
        questionsOption3Ports.out.link(bobQuestion2Node.fromPort),
        bobQuestion2Node.okPort.link(bobPlaceChoice1Ports.in),
        bobPlaceChoice1Ports.out.link(bobPlace1Node.fromPort),
        bobPlace1Node.okPort.link(storiesOption3Ports.in),
        bobPlace1Node.homePort.link(questionsOption1Ports.in),
        bobPlaceChoice2Ports.out.link(bobPlace2Node.fromPort),
        bobPlace2Node.okPort.link(storiesOption4Ports.in),
        bobPlace2Node.homePort.link(questionsOption1Ports.in),

        // Stories
        storiesOption1Ports.out.link(aliceStory1Node.fromPort),
        storiesOption2Ports.out.link(aliceStory2Node.fromPort),
        storiesOption3Ports.out.link(bobStory1Node.fromPort),
        storiesOption4Ports.out.link(bobStory2Node.fromPort),

        // After a story is played, automatically go back to question 1
        aliceStory1Node.okPort.link(questionsOption1Ports.in),
        aliceStory2Node.okPort.link(questionsOption1Ports.in),
        bobStory1Node.okPort.link(questionsOption1Ports.in),
        bobStory2Node.okPort.link(questionsOption1Ports.in)
    );

    return model;
}
